import React from 'react';
import faker from 'faker';


const Card = (props) => {
  return (
		<div className="ui card">
			<div className="image">
				<img alt="abstract" src={props.image} />
			</div>
			<div class="content">
				<div className="header">
					{props.title}
				</div>
			</div>
			<div class="content">
			<div className="description">
				{props.description}
			</div>
			</div>
			
    	<a href="/" className="button">{props.link1}</a>
			<a href="/" className="button">{props.link2}</a>
		</div>

  );
};

export default Card;
